sq--src-components-helmet-js.query:
query HelmetQuery {
  contentfulAbout {
    name
    description
    profile {
      favicon16: resize(width: 16) {
        src
      }
      favicon32: resize(width: 32) {
        src
      }
      bigIcon: resize(width: 192) {
        src
      }
      appleIcon: resize(width: 180) {
        src
      }
    }
  }
}

sq--src-sections-about-js.query:
query AboutMeQuery {
  contentfulAbout {
    aboutMe {
      childMarkdownRemark {
        rawMarkdownBody
      }
    }
    profile {
      title
      image: resize(width: 450, quality: 100) {
        src
      }
    }
  }
}

sq--src-sections-landing-js.query:
query SiteTitleQuery {
  contentfulAbout {
    name
    roles
    socialLinks {
      id
      url
      name
      fontAwesomeIcon
    }
  }
}

sq--src-sections-projects-js.query:
query ProjectsQuery {
  contentfulAbout {
    projects {
      id
      name
      description
      projectUrl
      repositoryUrl
      publishedDate(formatString: "YYYY")
      type
      logo {
        title
        image: resize(width: 200, quality: 100) {
          src
        }
      }
    }
  }
}

sq--src-sections-writing-js.query:
query MediumPostQuery {
  isMediumUserDefine: __type(name: "contentfulAboutMediumUserQueryString_2") {
    name
  }
  allMediumPost(limit: 6, sort: {fields: createdAt, order: DESC}) {
    edges {
      node {
        id
        uniqueSlug
        title
        createdAt(formatString: "MMM YYYY")
        virtuals {
          subtitle
          readingTime
          previewImage {
            imageId
          }
        }
        author {
          username
        }
      }
    }
  }
}
